import  classes from './MealsItemForm.module.css'
import Input from '../UI/Input';
const MealsItemForm = (props) => {
    return <form classes = {classes.form}>
         <Input
          label="Amount" input={{
            id: 'amount',
            type:'number',
            min: '1',
            max: '5',
            step: '1',
            defaultValue: '1'
         }}/>
        <button className={classes.button}>+ Add</button>
    </form>
}

export default MealsItemForm;
